    const userHandler = () => {
        setLogin(!login) && setRegister(!register)
    }





    return (
        <>
            <div className="user">
                <div className="userLogin">
                    <div className="loginDetails">
                        <span className="loginTitle">Bienvenido,
                            carnavalero</span>
                    </div>
                    <UserLogin />
                    <UserRegister />
                </div>
            </div>


        </>
    );
}

